Your midwives will be doing a discreet little observation of your baby’s appearance and vital signs at birth.⁣
⁣
There is a huge range of normal!⁣
⁣
As with weight, height, skin tone, hair colour, pregnancy length, position, length of labour..... the range of normal is bigger than you may think.⁣
⁣
It can really help (especially birth partners) to know this.⁣
⁣
Did your baby have something surprising about it’s appearance when you first met them?⁣
⁣
